import React, { Component } from 'react'

class User extends Component {
  render() {

    //Destructing
    return (
      <div>
      <ul>
        <li>Isim :{this.props.name} </li>
        <li>Departman : {this.props.department} </li>
        <li>Maas : {this.props.salary}</li>
      </ul>
      </div>
    )
  }
}
export default User;
